import React from 'react'
import { Link } from 'react-router-dom';

function Products() {
    return (
        <section>
            <h1>Products Selling Page</h1>

            <ul>
                <li>
                    <Link to="/products/p1"> Paints</Link>
                </li>
                <li>
                    <Link to="/products/p1">Shirts </Link>
                </li>
                <li>T-shirts</li>
            </ul>
        </section>
    )
}

export default Products;
